import React from "react";

const Content = () =>{

    return(

        <>

                <div className="box_center">
                     
                  <div className="content">
                    <div className="title">Title</div>
                    <ol><li>
                        Hello all
                    </li></ol> 
                    <button className="button"></button>
                </div>            
                      
            </div>



        </>
    );
}
export default Content;
